SELECT InvoiceId, CustomerId, InvoiceDate, Total 
FROM Invoice 
WHERE BillingCountry = 'Germany' AND Total BETWEEN 5 AND 10;

SELECT ArtistId, Name
FROM Artist
WHERE ArtistId IN (
    SELECT ArtistId
    FROM Album
    WHERE AlbumId NOT IN (
        SELECT AlbumId
        FROM Track
    )
);

SELECT BillingCountry, CAST(COUNT(*) AS REAL) * 100 / ( SELECT COUNT(*) FROM Invoice ) AS percentage
FROM Invoice
GROUP BY BillingCountry;
